import React from 'react'
import './Projects.css'
import useTypewriter from 'typewriter-effect'

const Projects = () => {
  const {text} = useTypewriter({
    words: [" Developer "," Fullstack "," Freelancer "," Player "],
    loop: 0, 
    typeSpeed: 150,
    deleteSpeed: 50,
    delaySpeed: 1000
  });
  return (
    <div > {
      text }
    </div>
  )
}

export default Projects
